def calculateTime(keyboard: str, word: str) -> int:
    pos = {char: idx for (idx, char) in enumerate(keyboard)}
    time = prev = 1
    for char in word:
        current = pos[char]
        if prev <= 26 and current >= 26:
            time += abs(current // 26 - prev // 26) + abs(current % 26 - prev % 26)
        else:
            time += abs(current - prev)
        prev = current
    return time

